('contact@selfizee.fr', 'GALERIE CARREFOUR LANGUEUX', 'Retrouvez votre photo de l\' Euro 2016', '<p class=\"p1\">Bonjour,</p><p class=\"p1\">Votre page souvenir contenant votre photo est accessible depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\">voir votre page souvenir</a>&nbsp;ou en cliquant sur la vignette ci-dessous :</p><p class=\"p1\">[[miniature_lien]]</p><p class=\"p1\"><span class=\"s1\">A très bientôt et merci de votre participation</span><br></p>', 0, 28, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
