('contact@selfizee.fr', 'Journal des Entreprises', 'Votre photo prise avec le Journal des Entreprises', '<p>Bonjour,</p><p>veuillez trouver votre photo prise avec le Journal Des Entreprises sur le lien suivant : <a href=\"[[lien_partage]]\">voir votre page souvenir</a>.</p><p> [[miniature_lien]]</p><p>Merci de votre participation !</p><p><br></p>', 0, 34, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Journal des Entreprises', 'Votre photo prise avec le Journal des Entreprises', '<p>Bonjour,</p><p>veuillez trouver votre photo prise avec le Journal Des Entreprises sur le lien suivant : <a href=\"[[lien_partage]]\">voir votre page souvenir</a>.</p><p> [[miniature_lien]]</p><p>Merci de votre participation !</p><p><br></p>', 0, 35, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('b.guyon@konitys.fr', 'Amélie et Benjamin', 'Votre photo souvenir du mariage !', '<p>Merci pour cette photo souvenir !</p><p>Retrouvez là sur ce lien : <em>[[miniature_lien]]</em></p><p><br></p><p>Merci encore pour votre présence. </p><p><br></p><p>A bientôt,</p><p>Amélie et Benjamin GUYON<br><br></p>', 0, 94, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('b.guyon@konitys.fr', 'Amélie et Benjamin', 'Votre photo souvenir du mariage !', '<p>Merci pour cette photo souvenir ! </p><p>Retrouvez là sur ce lien : <em>[[miniature_lien]]</em></p><p>Merci encore pour votre présence. </p><p>A bientôt,</p><p>Amélie et Benjamin GUYON<br><br></p>', 0, 95, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('nicolas@piloconsult.com', 'Nicolas', 'Test mail', '<p><em style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">Bonjour<br><br>Test e-mail<br><br>[[email]], [[prenom]], [[nom]], [[lien_partage]], [[extra]], [[extra2]], [[miniature]], [[miniature_lien]]<br></em><br>Merci</p>', 1, 101, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('nicolas@piloconsult.com', 'Nicolas', 'Test', '<p>bla bla bla&nbsp;<br><br><em style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">[[email]], [[prenom]], [[nom]], [[lien_partage]], [[extra]], [[extra2]], [[miniature]], [[miniature_lien]]</em><br></p>', 1, 121, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Tournoi Européen U21', 'Votre photo du tournoi Européen U21', '<p style=\"font-size:12.8px;line-height:18.5714px\">Bonjour,</p><p style=\"font-size:12.8px;line-height:18.5714px\">Merci à tous d\'être venus pour la 19ème édition du Tournoi Révélateur de Talent, le Tournoi Européen U21 !</p><p style=\"font-size:12.8px;line-height:18.5714px\"><span style=\"line-height:18.5714px\">Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cet événement.&nbsp;</span><span style=\"line-height:18.5714px\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux</span><span style=\"line-height:18.5714px\">&nbsp;!</span><br></p><p style=\"font-size:12.8px;line-height:18.5714px\"><span style=\"line-height:18.5714px\">Une <a href=\"[[lien_partage]]\">page spécifique a été créé avec votre photo</a> permettant de la partager en un clic :&nbsp;</span></p><p style=\"font-size:12.8px;line-height:18.5714px\"><span style=\"line-height:18.5714px\">[[miniature_lien]]</span><em style=\"font-size:12.8px;line-height:18.5714px\"></em></p><p style=\"font-size:12.8px;line-height:18.5714px\">A bientôt,</p><p style=\"font-size:12.8px;line-height:18.5714px\">L\'équipe du Centre Technique Bretagne Henri Guerin</p>', 0, 123, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'BRANDEET', 'Votre photo du mariage de Corentin & Laura', '<p>Bonjour,</p><p>voici votre photo prise lors du mariage : [[miniature_lien]]&nbsp;</p>', 0, 124, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Saint-Brieuc Entreprises', 'Votre photo souvenir du Dîner en Blanc', '<p>Bonjour,</p><p><span style=\"line-height: 1.42857;\">Saint-Brieuc\r\n Entreprises vous remercie de votre présence au premier Dîner en Blanc \r\nbriochin du 27 août 2016 et a le plaisir de vous\r\n offrir cette photo souvenir que vous pouvez imprimer ou partager sur \r\nles réseaux sociaux dès à présent.</span></p><p><span style=\"line-height: 1.42857;\">Elle est accessible sur votre page souvenir disponible <a href=\"[[lien_partage]]\">à cette adresse</a>.<br></span></p><p> [[miniature_lien]]</p><p>A bientôt !</p>', 0, 129, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Selfizee', 'Your photo', '<p>Hello,</p><p>this is a test, this is your photo : [[miniature_lien]]</p>', 0, 130, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Tussock Jumper', 'Your photo from Jumbo Food Markt', '<div style=\"line-height: 1.42857; display: inline;\">Merci \r\npour votre visite a notre dégustation -Thank you for visiting our tasting - Dank \r\nu voor uw aanwezigheid bij de proeverij</div><div style=\"font-size: small; line-height: 1.42857; font-family: Calibri; display: inline;\">&nbsp;</div><div style=\"font-size: small; line-height: 1.42857; font-family: Calibri; display: inline;\"><br></div><div style=\"font-size: small; line-height: 1.42857; font-family: Calibri; display: inline;\"><br></div><div style=\"display: inline;\"><div>A specific page has been created where you can download and share your picture with others :&nbsp;<a href=\"[[lien_partage]]\">click this link</a>.</div><div><br></div><div>[[miniature_lien]]</div><div><br></div><div><div style=\"color: rgb(51, 51, 51);\">Best Regards</div><div style=\"color: rgb(51, 51, 51);\"><br></div><div style=\"color: rgb(51, 51, 51);\">Tussock Jumper Wines</div></div></div>', 0, 131, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SPACE 2016', 'Votre photo prise lors du SPACE 2016 // Your photo from SPACE 2016', '<p>Bonjour // Hello,</p><p><span style=\"line-height: 18.5714px;\">Cliquez sur la vignette de votre photo pour accéder à votre<a href=\"[[lien_partage]]\"> page souvenir</a> de votre visite au SPACE 2016. V</span><span style=\"line-height: 18.5714px;\">ous pouvez télécharger votre photo et aussi la partager en 1 clic sur vos réseaux sociaux préférés.</span><span style=\"line-height: 18.5714px;\">&nbsp;// &nbsp;</span><span style=\"line-height: 1.42857;\">A <a href=\"[[lien_partage]]\">specific page</a> has been created where you can download and share your picture with others :</span></p><p>[[miniature_lien]]</p><p><span style=\"line-height: 1.42857;\">Merci // Thanks</span><br></p>', 0, 133, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Cordon Golf Open / Gites de France ', 'Votre photo du Cordon Golf Open', '<p>Bonjour,</p><p>Le Cordon Golf Open et son partenaire Gîtes de France, sont heureux de vous offrir cette <a href=\" [[miniature_lien]]\">photo souvenir</a>. Merci pour votre participation et rendez-vous l\'année prochaine !</p><p>[[miniature_lien]]</p><p>N\'hésitez pas à consulter la <a href=\"https://www.facebook.com/cordongolfopen/\" target=\"_blank\">page Facebook de l\'événement </a>pour retrouver de nombreuses autres photos.</p>', 0, 134, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SDAEC - TERRALLIANCE', 'Votre photo souvenir du SPACE 2016', '<p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">Bonjour,</p><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">le SDAEC et TERRALLIANCE vous remercient de votre visite lors du SPACE 2016.&nbsp;</p><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">Veuillez trouver votre photo prise lors de cet événement sur&nbsp;<a href=\"[[lien_partage]]\">votre page souvenir</a>.&nbsp;</p><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">[[miniature_lien]]</p><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\"><b>Gagnez un WE pour 2 personnes aux Domaines des Ormes!\r\n</b></p><div>Pour cela, il suffit de:</div><div>1- Aimez la page <a href=\"https://www.facebook.com/sdaecterralliance/\" target=\"_blank\">SDAEC TERRALLIANCE</a> sur Facebook</div><div>2- Likez votre photo</div><div>3- Partagez votre photo afin de récolter le maximum de j\'aime.</div><div><br>\r\n</div><div>La photo qui remportera le maximum de \" J\'aime\" d\'ici mardi 20 septembre à 9h, remportera un WE pour 2 personnes.</div><div><br>\r\n</div><div>Les photos seront disponibles dès demain sur notre page Facebook!</div><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><div>A vos Likes!!</div><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">A bientôt,</p><p style=\"color: rgb(57, 62, 72); font-size: 14px; line-height: 20px;\">Le SDAEC / Terralliance.</p><div><br></div>', 0, 141, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SPACE 2016', 'Votre photo prise lors du SPACE 2016 // Your photo from SPACE 2016 ', '<p class=\"p1\"><span class=\"s1\">Bonjour // Hello,</span></p><p class=\"p1\"><span class=\"s1\">Cliquez sur la vignette de votre photo pour accéder à votre<a href=\"[[lien_partage]]\"><span class=\"s2\"> page souvenir</span></a> de votre visite au SPACE 2016. Vous pouvez télécharger votre photo et aussi la partager en 1 clic sur vos réseaux sociaux préférés.&nbsp;// &nbsp;A <a href=\"http://www.selfizee.fr/theevent/cadre-data/%5B%5Blien_partage%5D%5D\"><span class=\"s2\">specific page</span></a> has been created where you can download and share your picture with others :</span></p>[[miniature_lien]]<p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"p2\"><span class=\"s1\">Merci // Thanks</span></p>', 0, 143, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'V&B Langueux', 'Votre photo des 8 ans du V&B Langueux', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">Toute l\'équipe du VandB Langueux vous remercie de votre présence pour son anniversaire du 17 septembre 2016.</span></p><p class=\"p1\"><span class=\"s1\">Cliquez sur <a href=\"[[lien_partage]]\">ce lien</a> </span><em style=\"line-height: 1.42857;\">&nbsp;</em><span style=\"line-height: 1.42857;\">pour retrouver &nbsp;votre</span><span style=\"line-height: 1.42857;\">&nbsp;photo souvenir.</span></p><p class=\"p1\"><span style=\"line-height: 1.42857;\">[[miniature_lien]]</span></p><p class=\"p1\">A très vite dans votre VandB préféré !</p>', 0, 144, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'MAZE BSA PLOUISY', 'Votre photo de l\'inauguration du MAZE BSA', '<p>Merci pour votre passage chez MAZE BSA Plouisy à l’occasion de son inauguration !</p><p>Nous sommes heureux de vous transmettre votre <a href=\"[[lien_partage]]\">photo souvenir</a>...</p><p>[[miniature_lien]]</p><p>A très bientôt !</p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p><br>\r\nL’équipe MAZE BSA Plouisy</p>', 0, 147, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
