('contact@selfizee.fr', 'Cabinet JF Meheust', 'Votre photo souvenir de la soirée d\'inauguration', '<p>Bonjour,</p><p>Nous vous remercions de votre présence lors de l\'inauguration des nouveaux bâtiments de notre cabinet !<br></p><p>Nous sommes heureux de vous transmettre votre <a href=\"[[lien_partage]]\">photo souvenir</a>, que vous pouvez télécharger et partager sur vos réseaux sociaux !&nbsp;</p><p>[[miniature_lien]]</p><p></p><p>A très bientôt !</p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p><br>\r\nL’équipe JF Meheust&nbsp;</p>', 0, 152, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Cabinet JF Meheust', 'Votre photo souvenir de l\'inauguration du cabinet ', '<p>Bonjour,</p><p>Nous vous remercions de votre présence lors de l\'inauguration des nouveaux bâtiments de notre cabinet !</p><p>Nous sommes heureux de vous transmettre votre <a href=\"[[lien_partage]]\">photo souvenir</a>, que vous pouvez télécharger et partager sur vos réseaux sociaux !&nbsp;</p><p>[[miniature_lien]]</p><p>A très bientôt !</p><p>L’équipe JF Meheust&nbsp;</p>', 0, 154, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'CDJ FACTORY & MINI STORE LANGUEUX', 'Votre photo souvenir de l\'inauguration du magasin CDJ FACTORY', '<p>Bonjour,<o:p></o:p></p><p>Nous vous remercions de votre présence à la\r\n soirée d’inauguration du nouveau magasin CDJ FACTORY en partenariat \r\navec le MINI STORE Langueux !<o:p></o:p></p><p>Nous sommes heureux de vous transmettre votre <a href=\"[[lien_partage]]\">photo souvenir</a>, que vous pouvez télécharger et partager sur vos réseaux sociaux !&nbsp;<o:p></o:p></p><p>[[miniature_lien]]<o:p></o:p></p><p>A très bientôt !<o:p></o:p></p><p class=\"MsoNormal\">L\'équipe du CDJ FACTORY &amp; MINI STORE Langueux&nbsp;</p>', 0, 157, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Autodistribution Armorique', 'Votre photo souvenir du salon professionnel AD', '<p><span style=\"line-height: 1.42857143;\">Toute l\'équipe d’Autodistribution Armorique vous remercie de votre présence au salon professionnel du 13 octobre à Ploufragan.</span></p><p>Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cet événement.&nbsp;</p><p>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</p><p>Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\">voir votre page souvenir</a>.</p><p>[[miniature_lien]]</p><p>A bientôt,</p><p>\r\n\r\n</p><p>L\'équipe d\'Autodistribution Armorique.</p>', 0, 158, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'ERGYSPORT', 'Votre photo souvenir du salon du trail des Templiers', '<p><span style=\"line-height: 1.42857;\">Bonjour,</span></p><p><span style=\"line-height: 1.42857;\">Toute\r\n        l\'équipe d’ERGYSPORT vous remercie de votre présence au salon du\r\n        trail lors du festival des Templiers.</span></p><p>Nous\r\n      profitons de cet e-mail pour vous envoyer la photo prise lors de\r\n      cet événement.&nbsp;</p><p>Vous\r\n      pourrez ainsi facilement la partager sur vos réseaux sociaux et\r\n      montrer que vous étiez présent !&nbsp;</p><p>Une\r\n      page souvenir spécifique a été créée avec votre photo permettant\r\n      de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\">voir votre page souvenir</a>.</p><p>[[miniature_lien]]</p><p>Sportivement,</p><p>\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    </p><p>L\'équipe\r\n      d\'ERGYSPORT</p>', 0, 173, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
