('contact@selfizee.fr', 'SELFIZEE', 'Votre photo souvenir du salon du mariage', '<p>Bonjour,</p><p>merci de votre visite sur notre stand lors du salon du mariage à Vannes.&nbsp;</p><p>Voici <a href=\"[[lien_partage]]\">votre photo </a>que pouvez télécharger et diffuser sur vos réseaux sociaux favoris :&nbsp;</p><p>[[miniature_lien]]</p><p>Nous restons à votre disposition pour la mise en place d\'une animation photo box lors de votre mariage !&nbsp;</p><p>A bientôt,</p><p>L\'équipe Selfizee&nbsp;</p>', 0, 195, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Del Arte Lyon', 'Photo souvenir de la soirée d\'inauguration du Del Arte Lyon - Dardilly', '<p>Bonjour,&nbsp;<br><br>toute l\'équipe de votre restaurant Del Arte de Lyon - Dardilly vous remercie de votre présence pour son inauguration.<br></p><p>Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cette soirée.&nbsp;</p><p>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cette superbe soirée !&nbsp;</p><p>Une page spécifique a été créé avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\" rel=\"noreferrer\">voir votre page souvenir</a>.</p><p> [[miniature_lien]]</p><p>\r\n</p><p>A très bientôt dans votre tout nouveau restaurant Del Arte Lyon - Dardilly .</p>', 0, 196, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Peugeot Chambéry – La Ravoire', 'Votre photo souvenir de la soirée de lancement du nouveau 3008', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16.5pt;\">Chères \r\nclientes, chers clients, <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16.5pt;\">Un \r\ngrand merci à tous pour votre \r\nparticipation qui a fortement contribué \r\nà la réussite de notre soirée \r\nde lancement du nouveau Peugeot 3008. \r\n<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16.5pt;\">Voici votre photo prise lors de cet événement à retrouver sur votre <a href=\"[[lien_partage]]\">page souvenir</a> :&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16.5pt;\">[[miniature_lien]]</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16.5pt;\">Votre \r\nseule présence a suffit à créer \r\nune superbe \r\nambiance et \r\nl’ensemble du personnel de Peugeot Chambéry – La Ravoire vous remercie très \r\nchaleureusement.</p><p>\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"line-height: 115%;\">A \r\ntrès vite chez Peugeot Groupe Bernard à Chambéry - La \r\nRavoire.</span></p>', 0, 197, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
