('contact@selfizee.fr', 'Auto Pièces Atlantique - Carmoine', 'Votre photo souvenir de l\'événement Facom Show', '<p class=\"p1\"><span class=\"s1\">Toute l\'équipe d’Auto Pièces &nbsp;Atlantique - Carmoine vous remercie de votre présence à l\'événement Facom Show du 17 novembre à Orvault.</span></p><p class=\"p1\"><span class=\"s1\">Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cet événement.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>.</span></p><p>[[miniature_lien]]</p><p class=\"p1\"><span class=\"s1\">A bientôt,</span></p><p class=\"p2\">L\'équipe d\'Auto Pièces Atlantique - Carmoine.<br><span class=\"s1\"></span></p>', 0, 200, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'VandB Annecy', 'Votre photo souvenir des 4 ans du VandB Annecy !', '<p>Bonjour,<o:p></o:p></p><p>Nous\r\n      vous remercions de votre présence à la soirée d’anniversaire des 4\r\n      ans du VandB Annecy !&nbsp;<o:p></o:p></p><p>Nous\r\n      sommes heureux de vous transmettre votre&nbsp;<a href=\"[[lien_partage]]\">photo\r\n        souvenir</a>, que vous pouvez télécharger et partager sur vos\r\n      réseaux sociaux !&nbsp;<o:p></o:p></p><p>[[miniature_lien]]</p><p>A\r\n      très bientôt !<br>\r\n    </p><p><o:p></o:p></p><p>\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    </p><p class=\"MsoNormal\">L\'équipe du VandB Annecy</p>', 0, 206, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'VandB Rennes sud-est', 'Votre photo souvenir de l\'inauguration du VandB Rennes sud-est', '<p>Bonjour,&nbsp;<br><br>toute l\'équipe de votre VandB Rennes sud-est vous remercie de votre présence pour son inauguration.<br></p><p>Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cette soirée.&nbsp;</p><p>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cette superbe soirée !&nbsp;</p><p>Une page spécifique a été créé avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\" rel=\"noreferrer\">voir votre page souvenir</a>.</p><p> [[miniature_lien]]</p><p>\r\n</p><p>A très bientôt dans votre tout nouveau VandB Rennes Sud-est.</p>', 0, 207, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SAINT BRIEUC ENTREPRISES', 'Soirée cinéma du 1er décembre au Cinéland', '<p>Bonjour,</p><p>Saint-Brieuc Entreprises vous remercie de votre présence à notre soirée cinéma du 1er décembre au Cinéland.</p><p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cette superbe soirée !&nbsp;</p><p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">Une page spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\" rel=\"noreferrer\" style=\"box-sizing: border-box; background: 0px 0px; color: rgb(51, 122, 183); text-decoration: none; text-shadow: none;\">voir votre page souvenir</a>.</p><p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;\"><br></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;\"> <!--[[miniature_lien]]--> <a href=\"[[lien_partage]]\">[[miniature]]</a></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">A très bientôt.<br></span><br></p>', 0, 208, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
INSERT INTO `email_configurations` (`email_expediteur`, `nom_expediteur`, `objet`, `content`, `is_photo_en_pj`, `evenement_id`, `created`, `modified`) VALUES
('contact@selfizee.fr', 'DEL ARTE Ploermel', 'Votre participation au grand Jeu de Noël du Del Arte Ploermel', '<p class=\"p1\"><span class=\"s1\">Bonjour</span></p><p class=\"p1\"><span class=\"s1\">Toute l\'équipe du Del Arte Ploermel vous remercie de votre présence dans notre restaurant.</span></p><p class=\"p1\"><span class=\"s1\"><a href=\"[[lien_partage]]\">Cliquez sur ce lien</a> &nbsp;</span><span style=\"line-height: 1.42857;\">pour</span><em style=\"line-height: 1.42857;\"> </em><span style=\"line-height: 1.42857;\">retrouver</span><em style=\"line-height: 1.42857;\"> &nbsp;</em><span style=\"line-height: 1.42857;\">votre</span><span style=\"line-height: 1.42857;\">&nbsp;photo prise en lors de notre animation pour le <b>grand Jeu de Noël qui se déroule du 15 décembre au 15 janvier 2017</b>.</span></p><p class=\"p1\"><span class=\"s1\">Un concours de LIKE Facebook est lancé sur <a href=\"https://www.facebook.com/delarte.ploermel/\" target=\"_blank\">notre page Del Arte Ploermel</a>.&nbsp;<br>Pour participer il faudra :<br>- liker la page Del Arte Ploermel<br>-</span><span style=\"line-height: 1.42857;\">&nbsp;trouver votre photo sur l\'Album dédié <br>- la partager le plus possible et demander à vos ami(e)s de cliquer sur \"J\'aime\"</span></p><p class=\"p1\"><b>Les 3 photos ayant le plus de \"J\'aime\" </b>au 31 décembre se partageront des lots selon leur choix, parmi : <br>- des bons d\'achat chez Sport 2000<br>- des bons d\'achat chez Joué Club (offert par Avis Immobilier)<br>- 1 ballon dédicacé du RCV (Rugby Club Vannes)<br>- 2 entrées au Futuroscope <br>- des repas chez Del Arte <br>- 2 abonnements d\'un trimestre dans la salle de sport \"Wake up\" <br>- des entrées au stade Rennais<br>- ...&nbsp;</p><p class=\"p1\"><b>Un tirage au sort sera également effectué parmi l\'ensemble des participants</b> ayant au minimum 10 \"J\'aime\" sur leur photo, avec un beau cadeau surprise à gagner !&nbsp;</p><p class=\"p1\">C\'est à vous de jouer !&nbsp;</p><p class=\"p1\">L\'équipe de votre Del Arte Ploermel</p><p class=\"p1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"logo-delarte.jpg\" style=\"width: 25%;\"><br></p>', 0, 215, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Selfizee', 'Votre photo souvenir de la place du Village By CA 22', '<p>Bonjour,</p><p>cette photo a été prise depuis la borne photo Selfizee, conçue par la SAS Konitys, 4ème startup à avoir intégré le Village by Ca à la rentrée 2017.&nbsp;</p><p>Nous pouvons vous accompagner sur l\'ensemble de vos événements pros &amp; privés : inaugurations, lancements, salons et foires, team building, animations, événements sportifs, mariages, anniversaires...</p><p>Retrouvez votre <a href=\"[[lien_partage]]\">photos souvenir</a> que vous pouvez partager sur vos réseaux sociaux favoris :&nbsp;</p><p>[[miniature_lien]]</p><p>A très bientôt !</p><p><br></p>', 0, 219, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Saint-Brieuc Armor Agglomération', 'Votre photo du Glazig', '<p><span style=\"line-height: 1.42857;\">Bonjour,</span></p><p><span style=\"line-height: 1.42857;\">Toute\r\n        l\'équipe de Saint-Brieuc Armor Agglomération &nbsp;vous remercie de votre participation au trail Glazig.</span></p><p>Nous\r\n      profitons de cet e-mail pour vous envoyer la photo prise lors de\r\n      cet événement.&nbsp;</p><p>Vous\r\n      pourrez ainsi facilement la partager sur vos réseaux sociaux et\r\n      montrer que vous étiez présent !&nbsp;</p><p>Une\r\n      page souvenir spécifique a été créée avec votre photo permettant\r\n      de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\">voir votre page souvenir</a>.</p><p>[[miniature_lien]]</p><p>Sportivement,</p><p>\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    </p><p>L\'équipe de Saint-Brieuc Armor Agglomération</p>', 0, 229, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Breizh PR', 'Votre photo souvenir de la découverte de la plateforme Breizh PR', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">Denis Cogrel, et toute l\'équipe de la plateforme Breizh PR &nbsp;vous remercie de votre présence à la journée découverte.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cet événement.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>.&nbsp;</span></p><p class=\"p1\">A bientôt,</p><p class=\"p2\">L\'équipe de la plateforme Breizh PR</p>', 0, 233, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Oscars des entreprises des Côtes-d\'Armor', 'Votre photo souvenir des Oscars des entreprises', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">toute l\'équipe des Oscars des entreprises des Côtes-d\'Armor vous remercie de votre présence lors de cet événement.</span></p><p class=\"p1\"><span class=\"s1\">Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cette soirée.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>.</span></p><p class=\"p1\">A bientôt,</p><p class=\"p2\">L\'équipe des Oscars des entreprises des Côtes-d\'Armor</p><p>\r\n<br></p>', 0, 235, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
