('contact@selfizee.fr', 'Triskalia', 'Votre photo souvenir du salon Agri Deiz', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">toute l\'équipe de Triskalia vous remercie de votre présence lors du salon Agri Deiz.</span></p><p class=\"p1\"><span class=\"s1\">Nous profitons de cet e-mail pour vous envoyer la photo prise sur le stand.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>.</span></p><p class=\"p1\">A bientôt,</p><p class=\"p2\">L\'équipe de La Boutik Triskalia<br /><a href=\"http://www.laboutik-triskalia.fr\" target=\"_blank\">http://www.laboutik-triskalia.fr</a></p>', 0, 242, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
