('contact@selfizee.fr', 'Del Arte Montpellier Castelnau', 'Votre photo souvenir de l\'inauguration du Del Arte', '<p>Bonjour,&nbsp;</p><p>Retrouvez votre photo souvenir sur ce lien :&nbsp;<a href=\"[[lien_partage]]\" target=\"_blank\" rel=\"noreferrer\">voir votre page souvenir</a>. Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cette superbe soirée !&nbsp;</p><p>\r\n</p><p>Toute l\'équipe vous remercie de votre présence. <br>A très vite dans votre nouveau restaurant Del Arte Montpellier Castelnau.</p>', 0, 247, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
