('contact@selfizee.fr', 'Office du Tourisme d\'Erquy ', 'Votre photo souvenir de la Fête de la Coquille Saint-Jacques', '<div>Bonjour,&nbsp;</div><div><br></div><p class=\"p1\"><span class=\"s1\">l\'Office du Tourisme d\'Erquy vous remercie de votre participation lors de la Fête de la Coquille Saint-Jacques.</span></p><p class=\"p1\"><span class=\"s1\">Votre page souvenir contenant votre photo est accessible depuis ce lien :&nbsp;<span class=\"s2\"><a href=\"[[lien_partage]]\">voir votre page souvenir</a>&nbsp;.</span></span></p><p class=\"p1\">A très bientôt sur Erquy !&nbsp;</p><p class=\"p1\">L\'Office du Tourisme d\'Erquy</p>', 0, 259, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Le Crédit Agricole Centre Loire', 'Le spot  : votre photo', '<p>Bonjour&nbsp;</p><div id=\"AppleMailSignature\">Voici la photo souvenir du Spot à <a href=\"[[lien_partage]]\">visualiser ici</a> !&nbsp;</div><div id=\"AppleMailSignature\">Merci d\'avoir participé !&nbsp;</div><div id=\"AppleMailSignature\"><br>\r\n</div><div id=\"AppleMailSignature\">A bientôt&nbsp;</div><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><div id=\"AppleMailSignature\">Le Crédit Agricole Centre Loire</div><div><br></div><div><br></div>', 0, 261, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Gare de Rennes', 'Votre photo souvenir des portes ouvertes de la gare de Rennes', '<p class=\"p1\"><span style=\"white-space: nowrap;\">Bonjour,</span></p><p class=\"p1\"> toute \r\nl\'équipe SNCF Gares &amp; Connexions - Gare de Rennes vous remercie de \r\nvotre présence lors des portes ouvertes des 13 et 14 mai derniers.<br> <br> <span style=\"white-space: nowrap;\">Nous&nbsp;profitons&nbsp;de&nbsp;cet&nbsp;e-mail&nbsp;pour&nbsp;vous&nbsp;envoyer&nbsp;la&nbsp;photo&nbsp;prise&nbsp;lors&nbsp;de&nbsp;</span><span style=\"white-space: nowrap;\">cet&nbsp;événement.</span><br> <br> <span style=\"white-space: nowrap;\">Vous&nbsp;pourrez&nbsp;ainsi&nbsp;facilement&nbsp;la&nbsp;partager&nbsp;sur&nbsp;vos&nbsp;réseaux&nbsp;sociaux.</span><br> <br>\r\n Une page souvenir spécifique a été créée avec votre photo permettant de\r\n la télécharger et de la partager depuis ce lien : &nbsp;<a href=\"[[lien_partage]]\" style=\"background-color: rgb(255, 255, 255);\"><span class=\"s2\">voir votre page souvenir</span></a>.<br> <br> <span style=\"white-space: nowrap;\">A&nbsp;bientôt,</span><br> <br> <span style=\"white-space: nowrap;\">L\'équipe&nbsp;gare&nbsp;de&nbsp;Rennes</span></p>', 0, 262, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Conseil Départemental des Côtes d\'Armor', 'Votre photo souvenir du festival Art Rock', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">le conseil Départemental des Côtes d\'Armor vous remercie de votre visite lors du Festival Art Rock.</span></p><p class=\"p1\"><span class=\"s1\">Votre page souvenir contenant votre photo est accessible depuis ce lien :&nbsp;<span class=\"s2\"><a href=\"[[lien_partage]]\">voir votre page souvenir</a>&nbsp;.</span></span></p><p class=\"p1\">A très bientôt !&nbsp;</p><p class=\"p1\">L\'équipe du conseil Départemental des Côtes d\'Armor.</p>', 0, 264, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Triskalia', 'Votre photo souvenir du salon Terralies', '<p class=\"p1\"><span class=\"s1\">Bonjour,</span></p><p class=\"p1\"><span class=\"s1\">toute l\'équipe de Triskalia vous remercie de votre présence lors du salon Terralies.</span></p><p class=\"p1\"><span class=\"s1\">Nous profitons de cet e-mail pour vous envoyer la photo prise sur le stand.&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent !&nbsp;</span></p><p class=\"p1\"><span class=\"s1\">Une page souvenir spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>.</span></p> <p class=\"p1\">A bientôt,</p><p class=\"p2\">L\'équipe de La Boutik Triskalia &nbsp; &nbsp;<br> <a target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\" title=\"http://goo.gl/LxfPx\" legend=\"http://goo.gl/LxfPx\" href=\"http://www.laboutik-triskalia.fr\">http://www.laboutik-triskalia.fr</a></p>', 0, 265, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Centre Commercial Carrefour Nantes La Beaujoire', 'Votre photo souvenir ', '<div>Bonjour,&nbsp;</div><div><br></div><p class=\"p1\"><span class=\"s1\">l’association\r\n des commerçants de votre Centre Commercial Carrefour Nantes La \r\nBeaujoire vous remercie de votre participation à son animation «Dites \r\nlui je t’aime en photo ».</span></p><p class=\"p1\"><span class=\"s1\">Votre page souvenir contenant votre photo est accessible depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>&nbsp;ou en cliquant sur la vignette ci-dessous :</span></p><p class=\"p1\">[[miniature_lien]]</p><p class=\"p1\">A très bientôt dans votre Centre Commercial Carrefour Nantes La Beaujoire</p>', 0, 266, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Centre Commercial Carrefour Brest Iroise', 'Votre photo souvenir ', '<div>Bonjour,&nbsp;</div><div><br></div><p class=\"p1\"><span class=\"s1\">l’association\r\n des commerçants de votre Centre Commercial Carrefour Nantes&nbsp;<span class=\"s1\">Brest Iroise</span>&nbsp;vous remercie de votre participation à son animation «&nbsp;<span class=\"s1\">Il y a du bonheur pour les Mamans&nbsp;</span>&nbsp;».</span></p><p class=\"p1\"><span class=\"s1\">Votre page souvenir contenant votre photo est accessible depuis ce lien :&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s2\">voir votre page souvenir</span></a>&nbsp;ou en cliquant sur la vignette ci-dessous :</span></p><p class=\"p1\">[[miniature_lien]]</p><p class=\"p1\">A très bientôt dans votre Centre Commercial Carrefour Brest Iroise</p>\r\n', 0, 267, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
