al&quot;,&quot;sans-serif&quot;\">voir\r\nvotre page souvenir</span></a><span class=\"s2\"><span style=\"font-size:11.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-theme-font:minor-fareast\">.</span></span><span style=\"font-size:\r\n11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"></span></p><p style=\"text-align:justify;line-height:115%\"><span style=\"font-size:11.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A très bientôt !</span></p><p style=\"text-align:justify;line-height:115%\"><span style=\"font-size:11.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">L\'équipe du Conseil Départemental 22.<br></span></p>', 0, 329, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SPACE RENNES', 'Votre photo souvenir du Space', '<p>Bonjour, <br><br>Toute l\'équipe du Space vous remercie de votre présence.<br><br>Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cette semaine. <br><br>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cette superbe soirée ! <br><br>Une page spécifique a été créé avec votre photo permettant de la télécharger et de la partager depuis ce lien : <a href=\"[[lien_partage]]\">voir votre page souvenir</a>.<br><br>A l\'année prochaine !<br></p>', 0, 373, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Space 2017', 'Votre photo du Space 2017 / Your photo from Space 2017', '<p>Bonjour // Hello,</p><p><span style=\"line-height: 18.5714px;\">Cliquez sur la vignette de votre photo pour accéder à votre<a href=\"[[lien_partage]]\"> page souvenir</a> de votre visite au SPACE 2017. V</span><span style=\"line-height: 18.5714px;\">ous pouvez télécharger votre photo et aussi la partager en 1 clic sur vos réseaux sociaux préférés.</span><span style=\"line-height: 18.5714px;\">&nbsp;// &nbsp;</span><span style=\"line-height: 1.42857;\">A <a href=\"[[lien_partage]]\">specific page</a> has been created where you can download and share your picture with others :</span></p><p>[[miniature_lien]]</p><p><span style=\"line-height: 1.42857;\">Merci // Thanks</span><br></p><p><br></p>', 0, 374, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Space 2017', 'Votre photo du Space 2017 / Your photo from Space 2017', '<p>Bonjour // Hello,</p><p><span style=\"line-height: 18.5714px;\">Cliquez sur la vignette de votre photo pour accéder à votre<a href=\"[[lien_partage]]\"> page souvenir</a> de votre visite au SPACE 2017. V</span><span style=\"line-height: 18.5714px;\">ous pouvez télécharger votre photo et aussi la partager en 1 clic sur vos réseaux sociaux préférés.</span><span style=\"line-height: 18.5714px;\">&nbsp;// &nbsp;</span><span style=\"line-height: 1.42857;\">A <a href=\"[[lien_partage]]\">specific page</a> has been created where you can download and share your picture with others :</span></p>\r\n<p> [[miniature_lien]]</p> <p><span style=\"line-height: 1.42857;\">Merci // Thanks</span><br></p><p><br></p>\r\n', 0, 375, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Cogedis', 'Votre photo du Space 2017', '<p>Bonjour,</p><p>Voici votre photo souvenir prise lors de votre visite sur notre stand lors du SPACE 2017.</p><p>Votre photo est disponible sur <a href=\"[[lien_partage]]\">votre page souvenir</a>, vous pourrez ainsi la télécharger et la partager sur vos réseaux sociaux.</p><p>[[miniature_lien]]</p><p>A bientôt,</p><p>L\'équipe Cogedis</p>', 0, 376, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Space 2017', 'Votre photo du Space 2017 / Your photo from Space 2017', '<p>Bonjour // Hello,</p><p><span style=\"line-height: 18.5714px;\">Cliquez sur le lien suivant pour accéder à votre<a href=\"[[lien_partage]]\"> page souvenir</a> de votre photo du SPACE 2017. V</span><span style=\"line-height: 18.5714px;\">ous pouvez télécharger votre photo et aussi la partager en 1 clic sur vos réseaux sociaux préférés.</span><span style=\"line-height: 18.5714px;\">&nbsp;// &nbsp;</span><span style=\"line-height: 1.42857;\">A <a href=\"[[lien_partage]]\" title=\"[[lien_partage]]\">specific page</a> has been created where you can download and share your picture with others</span></p><p><span style=\"line-height: 1.42857;\">Merci // Thanks</span><br></p><p><br></p>\r\n', 0, 377, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Itek', 'Votre photo souvenir du Space avec Itek', '<p>Bonjour, <br><br>toute l\'équipe de Itek vous remercie de votre présence durant le Space.<br><br>Nous profitons de cet e-mail pour vous envoyer la photo prise lors de cet évènement. <br><br>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent ! <br><br>Une page spécifique a été créé avec votre photo permettant de la télécharger et de la partager depuis ce lien : <a href=\"[[lien_partage]]\">voir votre page souvenir</a>.<br><br>A très bientôt chez Itek.<br></p>', 0, 389, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Novotel', 'Votre photo souvenir de l\'inauguration du Novotel de Saint-Brieuc', '<p class=\"p1\">Bonjour,</p><p class=\"p1\"><br></p><p class=\"p1\">l\'équipe du Novotel de Saint-Brieuc vous remercie de votre présence lors de son inauguration.</p><p class=\"p1\"><br></p><p class=\"p1\">Vous trouverez la photo prise lors de cet événement accessible sur&nbsp;<a href=\"[[lien_partage]]\"><span class=\"s1\">votre page souvenir</span></a>.</p><p class=\"p1\"><br></p><p class=\"p1\">[[miniature_lien]]</p><p class=\"p1\"><br></p><p class=\"p1\">A bientôt,</p><p>\r\n\r\n\r\n\r\n\r\n<style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; color: #454545}\r\nspan.s1 {color: #e4af09}\r\n</style>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"p1\">L\'équipe du Novotel</p>', 0, 391, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
