('contact@selfizee.fr', 'La French Tech', 'Your picture by the French Tech booth at CES 2018', '<p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">Hi,</span></p><p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">Thanks for\r\n        stopping by the French Tech booth at CES 2018.</span></p><p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">We hope you\r\n        enjoyed visiting French startups and their great innovations!</span></p><p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">Here is the\r\n        link to get your picture:<em> </em></span><em><a href=\"[[lien_partage]]\">[[lien_partage]]</a></em><span style=\"color:windowtext;mso-fareast-language:EN-US\"><br></span></p><p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">If you need\r\n        more info, please visit: <a href=\"meetlafrenchtech.com\">meetlafrenchtech.com</a> and follow us on\r\n        social media!</span></p><p class=\"MsoNormal\"><span style=\"color:windowtext;mso-fareast-language:EN-US\">Thanks,</span></p><p>\r\n    <span style=\"color:windowtext;mso-fareast-language:EN-US\">La French\r\n      Tech</span><br></p>', 0, 500, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
INSERT INTO `email_configurations` (`email_expediteur`, `nom_expediteur`, `objet`, `content`, `is_photo_en_pj`, `evenement_id`, `created`, `modified`) VALUES
('contact@selfizee.fr', 'CNOSF', 'Votre photo souvenir du Festival Olympique', '<p>Bonjour,&nbsp;</p><p>\r\n      <br></p><p>vous trouverez via le lien suivant votre souvenir du passage au\r\n        Festival Olympique.&nbsp;<br>\r\n      </p><p>\r\n      <br></p><p>Vous pourrez ainsi facilement la partager sur vos réseaux\r\n        sociaux et montrer que vous étiez présent à cet événement !</p><p>\r\n      <br></p><p><a href=\"http://ulk.mj.am/lnk/AEMAScrBW5cAAbPuV60AAF-bCFsAAPyRolIAAAAAAAAuYABagW8Dk-n0Mq5SS0-u1JUCNoJnbwAANT0/1/xar1LqZMhF82XoOrdM5CEA/aHR0cDovL2V2ZW50LnNlbGZpemVlLmZyL3AvY2QzOGNiMDk\"></a></p><p>\r\n      <em>[[miniature_lien]]</em><br></p><p>Retrouvez votre souvenir via ce lien :&nbsp;<a href=\"[[lien_partage]]\">page photo souvenir</a>.<br>\r\n        <br>\r\n        A très bientôt,<br>\r\n      </p><p>\r\n      <br></p><p>Le Comité National Olympique et Sportif Français</p><p><img src=\"data:image/png;base64,%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%%0A%20AAAASUVORK5CYII=\" data-filename=\"Image1.png\" style=\"width: 337.1612903225806px;\r\n          height: 130px;\">\r\n        </p>', 0, 502, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
INSERT INTO `email_configurations` (`email_expediteur`, `nom_expediteur`, `objet`, `content`, `is_photo_en_pj`, `evenement_id`, `created`, `modified`) VALUES
('contact@selfizee.fr', 'CNOSF', 'Votre photo souvenir du Festival Olympique', '<p>Bonjour,&nbsp;</p><p>vous trouverez via le lien suivant votre souvenir du passage au Festival Olympique.&nbsp;<br></p><p>Vous pourrez ainsi facilement la partager sur vos réseaux sociaux et montrer que vous étiez présent à cet événement !</p><p>[[miniature_lien]]</p><p>Retrouvez votre souvenir via ce lien :&nbsp;<a href=\"[[lien_partage]]\">page photo souvenir</a>.<br><br>A très bientôt,<br></p><p>Le Comité National Olympique et Sportif Français</p><p><img src=\"data:image/png;base64,\" data-filename=\"Image1.png\" style=\"width: 337.1612903225806px; height: 130px;\"><br></p><p><br></p>', 0, 503, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Banque Populaire ', 'Votre photo souvenir de l\'événement ', '<p>Bonjour,</p><p>merci de votre visite à l\'événement Banque Populaire - Let\'s Go ! </p><p>Voici votre photo souvenir, à partager avec vos amis : <a href=\"[[lien_partage]]\" style=\"background-color: rgb(255, 255, 255);\">voir la photo</a>.</p><p>[[miniature_lien]]</p><p>A bientôt</p><p><br></p>', 0, 505, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Côtes d\'Armor', 'Votre photo souvenir du Salon du Tourisme à Rennes', '<p>Bonjour,<br></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;WeblySleek UI Semilight&quot;,sans-serif\">Nous\r\n sommes ravis de vous avoir rencontré sur le stand «&nbsp;Tout Vivre en Côtes\r\n d’Armor&nbsp;» à l’occasion du salon du tourisme de Rennes.</span><span style=\"font-size:11.0pt;font-family:&quot;WeblySleek UI Semilight&quot;,sans-serif\"></span></p><p>\r\nNous vous invitons à retrouver votre photo souvenir via cette page : <a href=\"[[lien_partage]]\">votre page souvenir</a>.<br></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;WeblySleek UI Semilight&quot;,sans-serif\">Nous espérons que vous avez pu découvrir les nombreux atouts des Côtes d’Armor et nous serons heureux de vous y accueillir<span style=\"color:red\">\r\n</span>prochainement.</span></p><p>\r\n<span style=\"font-family:&quot;WeblySleek UI Semilight&quot;,sans-serif\">Retrouvez toute l’information touristique sur\r\n</span><b><span style=\"font-size:16.0pt;font-family:&quot;WeblySleek UI Semilight&quot;,sans-serif\"><a href=\"http://www.cotesdarmor.com\">www.cotesdarmor.com</a></span></b><br></p>', 0, 508, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Réseau Produit En Bretagne', 'AG Produit en Bretagne : votre photo souvenir', '<p><span style=\"color:black\">Bonjour, </span></p><p><span style=\"color:black\">merci d’avoir participé à l’assemblée\r\n générale de Produit en Bretagne, </span></p><p><span style=\"color:black\">vous trouverez votre photo souvenir en\r\n cliquant sur le lien suivant</span> : <a href=\"[[lien_partage]]\">voir votre page souvenir</a>. <br><br>A très bientôt !<br><br></p><p><br></p>', 0, 510, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Grand\'Ouest Innovations', 'Votre photo souvenir de Grand\'Ouest Innovations', '<p>Bonjour,</p><p>Retrouvez votre photo souvenir <a href=\"[[lien_partage]]\">sur cette page</a>.</p><p>En souvenir de votre passage à Grand\'Ouest Innovations 2018, en espérant que vous aurez apprécié !</p><p>L\'équipe organisatrice<br></p>', 0, 511, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Casino Saint Quay Portrieux', 'Votre photo souvenir de la soirée Chippendales au Casino de Saint-Quay-Portrieux', '<p>Bonjour,</p><p>retrouvez votre photo souvenir de la soirée au Casino de Saint-Quay-Portrieux via ce lien : <a href=\"[[lien_partage]]\">voir votre page souvenir.</a></p><p>toute l\'équipe vous remercie de votre présence !<br></p><p>A bientôt !<br><br></p>', 0, 512, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Bonobo', 'Votre photo #TeamBonoboJeanVert', '<p>Bonjour,</p><p>voici votre photo prise ce jour #TeamBonoboJeanVert à découvrir <a href=\"[[lien_partage]]\">depuis ce lien</a>&nbsp;.</p><p>[[miniature_lien]]</p><p>L\'équipe Bonobo</p>', 0, 515, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Groupama Loire-Bretagne', '#FANZONEGROUPAMA : Votre photo souvenir du Match Quimper Volley 29 contre l\'ASPTT Mulhouse Volley en championnat de ligue A Féminine', '<p>Bonjour, <br><br>Groupama Loire Bretagne et le Quimper Volley 29 vous remercient de votre présence au match de Ligue A Féminine du dimanche 4 mars, à 17 h, contre l\'ASPTT Mulhouse Volley.<br><br>Nous profitons de ce message pour vous envoyer la photo prise lors de cette rencontre sportive.<br><br>N\'hésitez pas à la partager sur vos réseaux sociaux afin de montrer votre soutien à l\'équipe du Quimper Volley 29.<br><br>Une page spécifique a été créée avec votre photo permettant de la télécharger et de la partager depuis ce lien : <a href=\"[[lien_partage]]\">voir votre photo souvenir. </a><br><br>Merci de votre présence et de votre participation à l\'animation photo mise en œuvre par Groupama Loire Bretagne.<br><br>Au plaisir de vous retrouver prochainement pour soutenir l\'équipe du Quimper Volley 29,<br><br>Bien cordialement.<br><br>Groupama Loire Bretagne &amp; le Quimper Volley 29&nbsp; <br></p>', 0, 518, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'EVENEMENT-DELL-2018', 'Votre photo souvenir de DELL évènement ', '<p>Bonjour, </p><p>voici votre photo prise pour l\'évènement de Dell à découvrir <a href=\"[[lien_partage]]\">depuis ce lien.</a></p><p>L\'équipe Dell.<br><br></p>', 0, 523, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'GEM Altigliss Challenge', 'Ta photo souvenir', '<p>Salut,</p><p>voici une photo souvenir de ta semaine offerte par Selfizee et le GEM \r\nAltigliss Challenge, n\'oublie pas de la partager avec tes potes ! A découvrir <a href=\"[[lien_partage]]\">sur ce lien</a>&nbsp;</p><p>[[miniature_lien]]</p>', 0, 524, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
INSERT INTO `email_configurations` (`email_expediteur`, `nom_expediteur`, `objet`, `content`, `is_photo_en_pj`, `evenement_id`, `created`, `modified`) VALUES
('contact@selfizee.fr', 'Selfizee', 'Votre photo du Sportem 2018', '<p style=\"margin-bottom: 10px;\">Bonjour,<br></p><p style=\"margin-bottom: 10px;\">merci de votre visite lors de l\'édition Sportem 2018, vous trouverez la photo prise avec la borne photo Selfizee depuis&nbsp;<a href=\"https://manager.brandeet.fr/albums/edit/[[lien_partage]]\" style=\"\">cette page souvenir</a>.&nbsp;</p><p style=\"margin-bottom: 10px;\">[[miniature_lien]]</p><p style=\"margin-bottom: 10px;\">Découvrez nos solutions #event #marketing :&nbsp;</p><p style=\"margin-bottom: 10px;\">- Brandeet : application mobile photo event et data collect :&nbsp;<a href=\"http://www.brandeet.fr\" style=\"\">www.brandeet.fr&nbsp;</a></p><p style=\"margin-bottom: 10px;\">- Selfizee : borne photo connectée à impression immédiate dans toute la France :&nbsp;<a href=\"https://www.selfizee.fr/\" style=\"\">www.selfizee.fr</a></p><p style=\"margin-bottom: 10px;\"><br>L\'équipe de la SAS Konitys !&nbsp;</p><p style=\"margin-bottom: 10px;\">Benjamin / Bertrand / Sébastien&nbsp;</p><p style=\"margin-bottom: 10px;\"><br></p><p style=\"margin-bottom: 10px;\">-------&nbsp;</p><p style=\"margin-bottom: 10px;\">Hello,&nbsp;</p><p style=\"margin-bottom: 10px;\">thank you for you visit @ Sportem 2018, please find your picture&nbsp;<a href=\"[[lien_partage]]\" style=\"\">on this link</a>&nbsp;.</p><p style=\"margin-bottom: 10px;\">[[miniature_lien]]</p><p style=\"margin-bottom: 10px;\">Discover ours #event #marketing solutions :&nbsp;</p><p style=\"margin-bottom: 10px;\">- Brandeet : photo mobile event application&nbsp; :&nbsp;<a href=\"http://www.brandeet.com/\" style=\"\">www.brandeet.com</a></p><p style=\"margin-bottom: 10px;\">- Selfizee : connected photobooth :&nbsp;<a href=\"https://www.selfizee.fr/\" style=\"\">www.selfizee.fr</a></p><p style=\"margin-bottom: 10px;\">See you soon !&nbsp;</p><p style=\"margin-bottom: 10px;\"><br></p><p style=\"margin-bottom: 10px;\">Your Konitys Team !&nbsp;</p><p style=\"margin-bottom: 10px;\">Benjamin / Bertrand / Sébastien&nbsp;</p>', 0, 525, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'POLYGONE-CONCEPT', 'Votre photo souvenir de Polygone Concept évènement', '<p>Bonjour voici votre photo du salon de l\'habitat de Saint-Brieuc</p><p><a href=\"[[lien_partage]]\">cliquez sur le lien pour voir votre photo</a><br></p><p>Polygone Concept<br></p>', 0, 527, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'EM-LYON-PARIS-BUSINESS-SCHOOL', 'Votre photo souvenir de EM LYON', '<p>Bonjour,</p><p>suite à lévènement du Mardi 13 Mars pour la EM-LYON-PARIS-BUSINESS-SCHOOL</p><p><a href=\"[[lien_partage]]\">voici le lien pour la photo</a></p><p>Bonne journée<br></p><p><br></p>', 0, 529, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'CA Finistère 2.9', 'Votre photo souvenir de Finistère 2.9 On Ice', '<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Bonjour,</b></p><p class=\"MsoNormal\">Tu as participé à la soirée<span style=\"mso-spacerun:yes\">&nbsp;\r\n      </span>Finistère 2.9 On Ice et toute l’équipe Finistère 2.9 t’en\r\n      remercie&nbsp;! Tu trouveras ta/tes photos ci-joint, tu peux les\r\n      partager grâce\r\n      au hashtag <b style=\"mso-bidi-font-weight:normal\">#onice2point9</b>.</p><p class=\"MsoNormal\"><a href=\"[[lien_partage]]\">voici le lien de votre photo</a><br></p><p>\r\n    Pour plus d’informations, viens visiter notre\r\n      site\r\n      internet&nbsp;:<span style=\"color:black;mso-fareast-language:FR\"> </span><a href=\"https://finistere2point9.fr\"><span style=\"mso-fareast-language:FR\">https://finistere2point9.fr</span></a><span style=\"color:black;mso-fareast-language:FR\"> et rejoins-nous sur\r\n      </span><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Tahoma&quot;,sans-serif;color:black;mso-fareast-language:FR\">Facebook&nbsp;:\r\n      </span><a href=\"https://muz10-e1owac.ca-technologies.credit-agricole.fr/owa/redir.aspx?SURL=Vj661Joo1qDII8kgjohsIxZcL5TR52or85BHYOk0C1lOcYFBIdfTCGgAdAB0AHAAcwA6AC8ALwB3AHcAdwAuAGYAYQBjAGUAYgBvAG8AawAuAGMAbwBtAC8AZgBpAG4AaQBzAHQAZQByAGUAMgBwAG8AaQBuAHQAOQA.&amp;URL=https%3a%2f%2fwww.facebook.com%2ffinistere2point9\" target=\"_blank\" title=\"Ctrl+Cliquer pour suivre le lien\"><span style=\"mso-fareast-language:FR\">https://www.facebook.com/finistere2point9</span></a><br></p>', 0, 530, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'AG Sports pour tous Montpellier', 'Photo évènement assemblée générale sports pour tous', '<p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">Bonjour,</p>\r\n    <p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">Betty Charlier,\r\n      Présidente de la Fédération Française Sports pour Tous, et ses\r\n      équipes vous remercient de votre présence pour l\'Assemblée\r\n      Générale Nationale 2018 à Montpellier (34) et ont le plaisir de\r\n      vous adresser votre photo souvenir !</p><p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\"><a href=\"[[lien_partage]]\">lien de votre photo</a><br></p>\r\n    <p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">Suivez les actualités de\r\n      la Fédération sur : (liens facebook, instgram, linkedin, youtube)</p>\r\n    <p style=\"margin: 0px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">À très bientôt !</p>', 0, 538, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@pouletdejanze.fr', 'Poulet De Janzé', 'Votre photo évènement Poulet de Janzé', '<p><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">Cot Cot Cot...</span></p><p><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\"><br></span><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">Vous vous êtes fait déplumer le portrait, quel beau poulet...de Janzé êtes-vous !</span></p><p><font face=\"SF Regular, Segoe UI Regular, sans-serif\"><span style=\"font-size: 16px;\"><a href=\"[[lien_partage]]\">Votre photo en lien ici</a></span></font></p><p style=\"line-height: 1;\"><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">À très vite pour de nouvelles aventures toujours aussi breizhées ! </span></p><p style=\"line-height: 1;\"><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">Les poulet(te)s de Janzé </span></p><p style=\"line-height: 1;\"><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">Retrouvez-nous dès maintenant sur Facebook et Instagram</span></p><p style=\"line-height: 1;\"><font face=\"SF Regular, Segoe UI Regular, sans-serif\"><span style=\"font-size: 16px;\">o&nbsp; &nbsp;<a href=\"https://www.facebook.com/pouletdejanze/\">https://www.facebook.com/pouletdejanze/</a></span></font></p><p style=\"line-height: 1;\"><font face=\"SF Regular, Segoe UI Regular, sans-serif\"><span style=\"font-size: 16px;\">o&nbsp; &nbsp;<a href=\"https://www.instagram.com/pouletdejanze/\">https://www.instagram.com/pouletdejanze/</a></span></font></p><p style=\"line-height: 1;\"><span style=\"font-family: &quot;SF Regular&quot;, &quot;Segoe UI Regular&quot;, sans-serif; font-size: 16px;\">www.poulet-de-janze.fr</span><br></p>', 0, 540, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Les Mauvais Gones Lyon', 'Votre photo souvenir du Festival Les Mauvais Gones Lyon', '<p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">« Chers Mauvais Gones,</p><p>\r\n    <br></p><p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">3 jours intenses avec\r\n      vous ! C\'est ça l\'expérience Mauvais Gones. Nous espérons que\r\n      l\'édition 2 vous a plu et on espère vous retrouver tout au long de\r\n      l\'année sur nos réseaux !</p><p>\r\n    <br></p><p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">Nous voudrions vous\r\n      remercier d\'avoir été présents et encore une fois remercier chacun\r\n      de nos mécènes et partenaires ayant fait de cet événement une\r\n      réalité.</p><p>\r\n    </p><p>Voici le lien pour votre photo: <a href=\"[[lien_partage]]\">ici</a><br></p><p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoration-style:\r\n      initial; text-decoration-color: initial;\">UGC, Charlestown,\r\n      Confluence, Le Groupe Bernard, Nissan, Coriolis, April, Sideo, Sup\r\n      de Pub.</p><p>\r\n    <br></p><p style=\"margin: 0px 0px 8px; text-overflow: ellipsis; word-wrap:\r\n      break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica\r\n      Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\r\n      font-style: normal; font-variant-ligatures: normal;\r\n      font-variant-caps: normal; font-weight: 400; letter-spacing:\r\n      normal; orphans: 2; text-align: start; text-indent: 0px;\r\n      text-transform: none; white-space: normal; widows: 2;\r\n      word-spacing: 0px; -webkit-text-stroke-width: 0px;\r\n      background-color: rgb(255, 255, 255); text-decoratio