('contact@selfizee.fr', 'TRAIL DES KAOS', 'Votre photo souvenir du trail des Kaos !', '<p>Bonjour,</p><p>Merci d’avoir participé au Trail des Kaos le 13 mai\r\n dernier&nbsp;! </p><p><a href=\"[[lien_partage]]\" target=\"_blank\">Voici votre photo de l\'événement ! </a></p><p>[[miniature_lien]]<br></p><p> N’hésitez pas à partager votre photo souvenir sur les réseaux\r\n sociaux.<br></p><p class=\"MsoNormal\">Rendez-vous pris l’année prochaine&nbsp;!</p><p><br></p><p class=\"MsoNormal\">Saint-Julien Team Running </p><p><br></p>', 1, 591, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Le petit echo de la mode', 'Votre photo souvenir', '<p>Bonjour,</p><p>Merci d\'être venu pour les 5 ans de L\'Effet Mode, n\'hésitez pas à nous rejoindre sur les réseaux sociaux ! #PetitEchoMode et&nbsp;<span class=\"atMention\" title=\"lpem22\" style=\"\">@LPEM22</span><br></p><p>Voici votre photo souvenir à consulter <a href=\"[[lien_partage]]\">depuis ce lien</a>&nbsp;</p><p>[[miniature_lien]]</p>', 0, 599, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Cerfrance Côtes d\'Armor', 'Votre photo Cerfrance', '<p>Bonjour,</p><p>Nous vous remercions de votre visite sur le stand Cerfrance Côtes d\'Armor et de votre participation à notre animation photo.</p><p>Retrouvez à partir de demain votre photo dans l\'album <a title=\"Page Cerfrance Côtes d\'Armor\" href=\"https://www.facebook.com/pg/cerfrance22/photos/?tab=album&amp;album_id=1880284558702029\">Facebook Cerfrance Côtes d\'Armor</a> et tentez de remporter une caméra Go Pro d\'une valeur de 219 €.</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word;\">Le principe ? ... la photo qui comptabilise le plus de « J\'aime » jusqu\'au MARDI 5 JUIN 2018 inclus remporte la caméra !<br>Alors n\'attendez plus... likez, partagez et sollicitez votre famille, vos amis !</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word;\">L\'équipe Cerfrance Côtes d\'Armor.</p>', 0, 600, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Mercedes Saint-Loup Lyon ', 'Votre photo souvenir de l\'évènement Mercedes Saint-Loup Lyon', '<p>Bonjour,<br>Merci d’avoir participé à cette superbe journée !<br>Voici un joli souvenir de ce moment ! </p><p><a href=\"[[lien_partage]]\">lien de votre photo souvenir</a><br></p><p><br>A très bientôt<br></p>', 1, 601, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Le Département des Côtes d\'Armor', 'Votre Photo Souvenir du Festival Art-Rock 2018 !', '<p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Bonjour</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Souvenirs de votre passage au Conseil départemental lors du Festival Art-Rock 2018, à consulter sur cette&nbsp;<a href=\"[[lien_partage]]\" style=\"background-color: rgb(255, 255, 255); color: rgb(35, 82, 124); text-decoration-line: underline; outline: 0px; cursor: pointer;\">page souvenir</a>.</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word;\">[[miniature_lien]]<br></p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">A diffuser sans modération sur les réseaux sociaux.</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Merci de votre visite</p><p style=\"margin-bottom: 0px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Le Département des Côtes d\'Armor</p>', 0, 602, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Gatsby Club Rennes', 'Votre photo souvenir de l\'évènement ', '<p>Merci de votre présence au Gatsby Club pour cette belle soirée Soooo Gatsby !</p><p>C\'est\r\n un plaisir de vous faire parvenir votre photo de la Birthday Retro \r\nParty... </p><p><a href=\"[[lien_partage]]\">Voici votre photo souvenir.</a></p><p>[[miniature_lien]]</p><p>N\'hésitez pas à partager ce souvenir avec vos ami(e)s sur vos \r\nréseaux sociaux !</p><p>Vous retrouverez beaucoup d\'autres photos de cette \r\nsoirée de folie sur nos réseaux sociaux Facebook Gatsby Club, Snapchat \r\ngatsbyclub35 et Instagram <span class=\"atMention\" title=\"gastbyclub35\">@gastbyclub35</span> ...</p><p>Nous espérons vous revoir très bientôt dans notre club ouvert toute l\'année, et aussi l\'été !</p><p>Toute l\'équipe du Gatsby Club vous souhaite une très belle journée...<br><br>N\'oubliez pas le Gatsby c\'est \"The Place To Be !\"</p>', 0, 604, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Silverwood', 'Votre photo souvenir du Carrefour International du Bois', '<p>Bonjour, </p><p>\r\nNous sommes très heureux de vous avoir accueilli sur le stand\r\n Silverwood lors du Carrefour International du Bois. </p><p>Vous avez pu\r\ndécouvrir nos dernières nouveautés : décoration intérieure,\r\ntendances bardages et terrasses, digital avec Wood Designer … </p><p>\r\n\r\nPour vous remercier, ci-joint un petit souvenir de votre passage à découvrir sur <a href=\"[[lien_partage]]\">votre page souvenir&nbsp;</a>.</p><p>[[miniature_lien]]</p><p>\r\n\r\n Vous pouvez partager cette photo depuis la page Facebook Silverwood :\r\n <a href=\"https://www.facebook.com/SilverwoodFR/\">https://www.facebook.com/SilverwoodFR/</a> <br>Rejoignez notre communauté en likant la page et partagez nos publications ! </p><p>\r\n \r\n A bientôt \r\n\r\nL’équipe Silverwood \r\n</p>', 0, 606, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Bretagne Conseil Elevage Ouest', 'Votre photo souvenir de l\'évènement', '<p>Bonjour,</p><p><br>Merci d’avoir participé à cette superbe journée !</p><p><br><a href=\"[[lien_partage]]\">Voici un joli souvenir de ce moment !</a></p><p>[[miniature_lien]]</p><p><br>A très vite</p><p><br>L\'équipe BCEL Ouest<br></p>', 1, 607, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'HAMON AUTOMOBILES', 'Votre photo souvenir de l\'évènement', '<p>Bonjour,</p><p><br>Merci d\'avoir participé à cette superbe journée !</p><p><br><a href=\"[[lien_partage]]\">Voici un joli souvenir de ce moment !</a></p><p>[[miniature_lien]]<br></p><p><br>A très bientôt.<br></p>', 1, 608, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Groupama et HC Dinan Quévert', ' #FanZoneGroupama - Votre photo souvenir du match de Nationale 1 Élite HC Dinan Quévert – AL Plonéour Lanvern', '<p><span style=\"font-size: 11.0pt; font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;; color: #262626; mso-style-textfill-fill-color: #262626; mso-style-textfill-fill-alpha: 100.0%\">\r\n<span style=\"font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;\">Bonjour,&nbsp;</span><br>\r\n<br>\r\n<span style=\"font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;\">Groupama\r\n Loire Bretagne et le HC Dinan Quévert vous remercient de votre présence\r\n samedi dernier à la salle Némée à Dinan pour soutenir les Blancs et \r\nBleus.</span><br>\r\n<br>\r\n<span style=\"font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;\">Nous\r\n vous remercions d’avoir pris part à l’animation Selfiebox &nbsp;et vous \r\nproposons de récupérer la photo prise lors de cette soirée.&nbsp;</span><br>\r\n<br>\r\n<span style=\"font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;\">Vous pouvez ainsi la partager facilement sur vos réseaux sociaux et montrer que vous supportez le HC Dinan Quévert.</span><br>\r\n<br></span><a href=\"[[lien_partage]]\">Voici donc votre photo. </a></p><p><span style=\"font-size: 11.0pt; font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;; color: #262626; mso-style-textfill-fill-color: #262626; mso-style-textfill-fill-alpha: 100.0%\">[[miniature_lien]]<br>\r\n<br>\r\n<span style=\"font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;\">Tous derrière le HC Dinan Quévert samedi 2 juin, 20h30, pour décrocher le\r\n10<sup>ème</sup> titre de Champion de France&nbsp;! </span></span>\r\n<br></p><p><span style=\"font-size: 11.0pt; font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;; color: #262626; mso-style-textfill-fill-color: #262626; mso-style-textfill-fill-alpha: 100.0%\">Sincères salutations.</span></p><p>\r\n<span style=\"font-size: 11.0pt; font-family: &quot;Leelawadee&quot;,&quot;sans-serif&quot;; color: #262626; mso-style-textfill-fill-color: #262626; mso-style-textfill-fill-alpha: 100.0%\">Groupama Loire Bretagne &amp; le HC Dinan Quévert.</span><br></p>', 1, 612, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'FUN BREIZH', 'Votre photo souvenir', '<p>Bonjour,</p><p><br>Merci d\'avoir participé à cette magnifique journée !</p><p><br><a href=\"[[lien_partage]]\">Voici un joli souvenir de votre soirée !</a></p><p>[[miniature_lien]]<br></p><p><br>A  bientôt<br></p>', 1, 613, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@konitys.fr', 'Petit echo de la mode', 'Votre photo souvenir', '<p>Bonjour,&nbsp;</p><p>Merci d\'être venu pour les 5 ans de L\'Effet Mode ! </p><p><a href=\"[[lien_partage]]\">Voici votre photo souvenir.&nbsp;</a></p><p>[[miniature_lien]]</p><p>N\'hésitez pas à nous rejoindre sur les réseaux sociaux ! #PetitEchoMode et @LPEM22<br></p>', 1, 616, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('guenael.lesourd@ldc.fr', 'LDC Huttepain', 'Votre photo souvenir Huttepain Bretagne', '<p>Bonjour, </p><p>Merci d\'avoir participé à cette fête pour le 10è anniversaire de Huttepain Bretagne.</p><p>Nous espérons que vous avez pris beaucoup de plaisir et que <a href=\"[[lien_partage]]\">la photo</a> est aussi réussie que la fête le fut.</p><p>[[miniature_lien]]</p><p>Merci d\'être à nos côtés</p><p style=\"line-height: 1;\">Bien à vous et à très vite</p><p style=\"line-height: 1;\">Toute l\'équipe de Huttepain Bretagne</p>', 0, 619, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@konitys.fr', 'Up France', ' Echanges Utilisateurs SOLIS 2018 - Votre photo souvenir', '<p>Bonjour,</p><p>Merci d\'avoir participé aux Échanges Utilisateurs SOLIS 2018.</p><p><a href=\"[[lien_partage]]\">Voici un souvenir de ce moment d\'échange et de convivialité.</a></p><p>[[miniature_lien]]</p><p>A très bientôt.</p><p>www.up-france.fr/simplifier</p><div><br></div>', 1, 621, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@konitys.fr', 'Conseil Régional Normandie', 'Votre photo souvenir', '<p>Bonjour,&nbsp;</p><p>Merci de votre soutien à la candidature des \"Plages du Débarquement, Normandie 1944\"</p><p>au patrimoine mondial de l\'UNESCO - www.liberte-normandie.com&nbsp;<br></p><p><a href=\"[[lien_partage]]\">Voici votre photo à télécharger ici</a></p><p><span style=\"color: rgb(57, 62, 72); font-size: 14px;\">[[miniature_lien]]</span><br></p>', 1, 631, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@konitys.fr', 'HUTTEPAIN BRETAGNE', 'Votre photo souvenir Huttepain Bretagne', '<p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Bonjour,</span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Merci d\'avoir participé à cette fête pour le 10è anniversaire de Huttepain Bretagne.</span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Nous espérons que vous avez pris beaucoup de plaisir et que la photo est aussi réussie que la fête le fut.</span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\"><a href=\"[[lien_partage]]\">Voici votre photo souvenir</a></span></font></p><p><span style=\"color: rgb(57, 62, 72); font-size: 14px;\">[[miniature_lien]]</span><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Merci d\'être à nos côtés</span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Bien à vous et à très vite</span></font></p><p><font color=\"#333333\" face=\"Helvetica Neue, Arial, Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Toute l\'équipe de Huttepain Bretagne</span></font></p>', 0, 634, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Les Bulles du 23', 'Votre photo souvenir des Bulles du 23', '<p>Bonjour,</p><p>voici votre photo prise lors de votre passage aux Bulles du 23, consultable depuis <a href=\"[[lien_partage]]\">votre page souvenir</a>.</p><p>[[miniature_lien]]</p><p>Merci de votre passage</p><p>L\'équipe des Bulles du 23</p>', 0, 638, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@konitys.fr', '60ème Congrès National', 'Voici votre photo souvenir !', '<p>Bonjour,&nbsp;</p><p>Merci d\'avoir participé au 60ème Congrès National de Rennes en Mai 2018.</p><p><a href=\"[[lien_partage]]\">Voici votre photo souvenir.</a></p><p>[[miniature_lien]]</p><p>Belle journée.</p>', 0, 642, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Arkéa', ' #RHDays : votre selfie souvenir.', '<p>Bonjour,</p><p>Vous vous êtes prêté(e) au jeu de la borne selfie à l\'occasion des #RHDays... <a href=\"[[lien_partage]]\">Voici votre photo souvenir !</a></p><p>En vous remerciant de votre présence et de votre participation à la réussite de cet événement.<span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">[[miniature_lien]]</span></p><p>Emmanuelle, Géraldine &amp; Julien</p>', 0, 646, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Carrefour', 'Souvenir photo', '<p>Voici <a href=\"[[lien_partage]]\">votre souvenir photo </a>lors de la fêtes des mères dans votre magasin Carrefour&nbsp;</p><p>[[miniature_lien]]</p><p>Belle journée&nbsp;</p>', 0, 648, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SOVAMEP', 'Souvenir photo des 30 ans de SOVAMEP', '<p>Bonjour,</p><p>Voici votre photo à retrouver sur <a href=\"[[lien_partage]]\">votre page souvenir</a>.&nbsp;</p><p>[[miniature_lien]]</p><p>Je tenais à vous remercier chaleureusement pour votre présence au 30 ans de SOVAMEP.</p><p>Votre présence, a joué un rôle dans la réussite de cet événement.</p><p>L\'ambiance était conviviale et chaleureuse. Tout ce que nous espérions en préparant cet événement.</p><p>Merci encore à vous et à très bientôt lors d\'un nouvel événement.</p><p>L\'équipe SOVAMEP.<br></p><p>N\'hésitez pas à venir liker <a href=\"https://www.facebook.com/SOVAMEP/\">nos pages Facebook</a> et <a href=\"https://www.linkedin.com/company/sovamep\">Linkedin</a> pour suivre notre actualité et retrouver l\'album photo de l\'événement !</p>', 0, 649, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('communication@kerval-centre-armor.fr', 'Kerval', 'Le recyclage en fête 2', '<p>Bonjour,</p><p>Grand merci à toutes et tous de votre venue au « Recyclage en fête 2 ! »\r\n à Lantic.</p><p><a href=\"[[lien_partage]]\">Voici votre photo souvenir</a></p><p>[[miniature_lien]]</p><p> </p><p>Vous pouvez continuer à nous suivre sur Facebook « Adoazan \r\nKerval ».</p><p> A très bientôt !<br></p>', 0, 656, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Visages du Monde Lamballe', ' Soirée spéciale Cuba - 7 Juin 2018 - Lamballe : votre photo souvenir !', '<p>hère Cliente, Cher Client,</p><p>Nous avons été ravis de vous accueillir à notre Soirée spéciale Cuba et nous vous invitons à retrouver votre photo, consultable<a href=\"[[lien_partage]]\"> sur ce lien.</a></p><p>[[miniature_lien]]</p><p><br></p><p>Notre équipe Visages du Monde Lamballe vous remercie pour votre fidélité et vous attend pour construire tous vos projets d\'escapades !</p><p>lamballe@visagesdumonde.fr</p><p>02.96.31.28.64</p>', 0, 658, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Looney Tunes Experience', 'Looney Tunes Experience', '<div class=\"\"><div class=\"\"><div style=\"margin: 0cm 0cm 0.0001pt;\" class=\"\"><span style=\"\" class=\"\">Estimado cliente,<br><br><o:p class=\"\"></o:p></span></div><div style=\"margin: 0cm 0cm 0.0001pt;\" class=\"\"><span style=\"\" class=\"\">Adjunto encontrará la foto de su Looney Tunes Adventure<o:p class=\"\"></o:p></span></div><div style=\"margin: 0cm 0cm 0.0001pt;\" class=\"\"><span style=\"\" class=\"\"><br>Aquí está su foto<o:p class=\"\"></o:p></span></div><div style=\"margin: 0cm 0cm 0.0001pt;\" class=\"\"><span style=\"\" class=\"\"><br>Saludos cordiales</span></div></div></div>', 1, 660, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Conseil Régional Normandie', 'Votre photo souvenir !', '<p>Bonjour, </p><p>Merci de votre soutien à la candidature des \"Plages du Débarquement, Normandie 1944\" au patrimoine mondial de l\'UNESCO</p><p> - <a href=\"http://www.liberte-normandie.com\">www.liberte-normandie.com</a><a href=\"http://www.liberte-normandie.com/\" target=\"_blank\" rel=\"noreferrer nofollow\"></a></p><p>Voici votre<a href=\"[[lien_partage]]\"> photo souvenir</a> !</p><p>[[miniature_lien]]&nbsp;</p><p>Belle journée<br><br></p>', 0, 661, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'CFAI Bretagne', 'Votre photo souvenir ', '<p>Séminaire du 31 mai - 1 juin 2018 </p><p>En espérant que tu aies passé un bon moment</p><p><a href=\"[[lien_partage]]\">Voici ta photo souvenir</a></p><p>[[miniature_lien]]</p>', 0, 667, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'communication@goconcept.com', 'Votre photo souvenir de l\'Inauguration Go Concept !', '<ul><li>Bonjour,</li>\r\n</ul><p>Vous trouverez ci-joint à cet e-mail <a href=\"[[lien_partage]]\">votre photo souvenir réalisée avec la box photo Selfizee</a> lors de l\'inauguration des nouveaux locaux Go\r\n Concept de Lyon !</p><p>[[miniature_lien]]</p><p>  </p><p>Nous espérons que vous avez passé une agréable soirée et vous remercions de votre venue.</p><p>Ce fut un plaisir de vous avoir à nos côtés !</p><p>A très bientôt !</p><p>Cordialement,</p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p>L\'équipe communication</p><p>Maxime Gradoux &amp; Manon Toulze<br></p>', 0, 676, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'ENEDIS', 'Votre photo souvenir', '<p><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\">Bonjour</span></p><p><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\"><br></span><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\">Merci d\'avoir participer au forum développement durable&nbsp; du 14 06 2018 USR MMN&nbsp;</span></p><p><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\"><a href=\"[[lien_partage]]\">Voici votre photo souvenir !</a></span></p><p><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\">[[miniature_lien]]</span></p><p><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\">Bonne fin de journée à vous&nbsp;</span></p>', 0, 684, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
