('contact@selfizee.fr', 'Visages du Monde Lamballe', ' Soirée spéciale Cuba - 15 Juin 2018 - St Brieuc : votre photo souvenir !', '<p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Chère Cliente, Cher Client,<br>Nous avons été ravis de vous accueillir à notre Soirée spéciale Cuba et nous vous invitons à retrouver votre photo, <a href=\"[[lien_partage]]\">consultable sur ce lien.</a><br>[[miniature_lien]]</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Notre équipe Visages du Monde Lamballe vous remercie pour votre fidélité et vous attend pour construire tous vos projets d\'escapades !<br><a href=\"mailto:stbrieuc@visagesdumonde.fr\" style=\"color: rgb(68, 68, 68);\">stbrieuc@visagesdumonde.fr</a><br>02.96.33.84.11</p>', 0, 686, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Albert Vieille', 'Votre photo 5 juin 2018 / June 5, 2018 memories', '<p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Bonjour,<br>Revivez les 50 ans de la société Albert Vieille en image. Veuillez trouver <a href=\"[[lien_partage]]\">vos photos ci-joint.</a></p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><br>[[miniature_lien]]<br>Bien cordialement,</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Toute l\'équipe d\'Albert Vieille.</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Hello,<br>Find attached your pictures from the Albert Vieille company 50th anniversary.<br>Best regards,</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Albert Vieille team.&nbsp;</p>', 1, 688, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Anconetti ', 'Remerciements Inauguration Anconetti', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Merci d\'avoir&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">contribué à faire de cette soirée une réussite&nbsp;</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><a href=\"[[lien_partage]]\">Voici votre photo souvenir !</a></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">[[miniature_lien]]</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Bonne journée à vous&nbsp;<br></span>L\'équipe Anconetti Toulon<br></p>', 0, 690, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Casino Circus de Carnac ', 'Photo souvenir', '<p>Tout l\'équipe du Casino Circus de Carnac et moi-même vous remercions d\'avoir fêté avec nous l\'anniversaire du Casino ! </p><p>J\'ai le plaisir de vous envoyer<a href=\"[[lien_partage]]\"> cette photo</a> en souvenir de cette journée festive et riche en surprises !</p><p>[[miniature_lien]]</p><p> </p><p><a href=\"https://www.instagram.com/casinocarnac/\">Rejoignez-nous</a> sur les<a href=\"https://www.facebook.com/CasinoDeCarnac https://www.instagram.com/casinocarnac/\"> réseaux sociaux</a> pour suivre toute l\'actualité du Casino et sur&nbsp;<a href=\"http://www.casinodecarnac.fr/\" target=\"_blank\" rel=\"noreferrer nofollow\">http://www.casinodecarnac.fr/</a></p><p>Monsieur Sébastien Larrieu</p><p>\r\n\r\n\r\n\r\n</p><p>Directeur Général&nbsp;</p>', 0, 696, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'ARKEA', 'Votre photo souvenir', '<p>Bonjour,</p><p>Vous vous êtes prêté(e) au jeu de la borne à selfie à l\'occasion du petit déjeuner de clôture de la semaine de la Qualité de Vie au Travail... <a href=\"[[lien_partage]]\">Voici votre photo souvenir !</a></p><p>[[miniature_lien]]</p><p>Un grand merci pour votre présence et votre participation !</p><p>PS : pensez à répondre au Baromètre QVT&nbsp; ;-)</p><p>L\'équipe Bien Vivre Au Travail&nbsp;</p>', 0, 697, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Chaussea Brest Iroise', 'Chaussea Brest Iroise vous remercie ! ', '<p>Bonjour,</p><p>Toute l\'équipe du magasin Chaussea de Brest Iroise a été ravie de vous accueillir samedi 23 juin ! </p><p><a href=\"[[lien_souvenir]]\">Voici votre photo souvenir !</a></p><p>[[miniature_lien]]</p><p>Nous espérons vous revoir bientôt !<br></p>', 0, 702, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('', '', '', '', 0, 707, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'SNI2A', 'Photo souvenir de votre Soirée des Regions', '<p>Bonjour, </p><p>\r\n\r\nCette année encore, vous nous avez régalé avec votre générosité et vos produits régionaux ! </p><p>Nous vous adressons 2018 MERCIS !</p><p>\r\n\r\nEt même si nous ne doutons pas que vous avez construit tous ensemble quelques souvenirs, nous sommes heureux de vous en adresser<a href=\"[[lien_partage]]\"> un de plus à ajouter à votre collection</a>.\r\n</p><p>[[miniature_lien]]</p><p>\r\n\r\nRestons connecté et à l\'année prochaine !\r\n\r\nSuivez-nous sur<a href=\"https://www.facebook.com/sni2a/\"> notre page Facebook&nbsp;</a></p>', 0, 716, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Matmut', 'Votre photo souvenir', '<p style=\"color: rgb(51, 51, 51); font-family: &quot;Lucida Grande&quot;, Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Toute l\'équipe MATMUT vous remercie de votre présence sous le stand au Mans.</span></p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Lucida Grande&quot;, Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Cliquez sur ce lien pour voir<a href=\"[[lien_partage]]\">&nbsp;votre&nbsp;photo en souvenir</a> !</span></p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Lucida Grande&quot;, Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Rejoignez-nous sur les<a href=\"https://fr-fr.facebook.com/MatmutAssurances/\"> réseaux sociaux</a> pour suivre l\'actualité de la Matmut.</span></p>', 0, 719, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Selfizee', 'Votre photo souvenir Défi Sport et Nature', 'Bonjour, \r\n\r\nMerci de votre participation à la 2ème édition du Défi Sport et Nature.\r\n\r\nVeuillez trouver ci-joint votre photo souvenir !\r\n\r\n[[miniature_lien]]\r\n\r\nBelle journée\r\n\r\n', 1, 720, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'BYPHASSE', 'Byphasse Iron Girl 2018', '<p>Chère Iron Girl,\r\n</p><p>\r\nMerci de nous avoir rendu visite sur le stand Byphasse Iron Gir.</p><p>Nous avons adoré partager ce moment avec vous !</p><p>Nous vous avons glissé en pièce jointe votre photo souvenir de l\'événement !\r\n</p><p>Nous espérons vous revoir bientôt !\r\n</p><p>\r\nA très vite !</p><p>L\'Équipe Byphasse.</p>', 1, 721, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Centre Commercial de l\'Oseraie', 'Votre photo souvenir', '<p>Bonjour,</p><p>Merci d\'avoir participé à cette superbe journée !<br>Voici un <a href=\"[[lien-partage]]\">joli souvenir de ce moment</a> !<br>A très bientôt</p><p>[[miniature_lien]]</p><p><br></p>', 0, 740, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Tanguy Matériaux', 'Votre photo souvenir !', '<p>Merci pour votre participation !</p><p>Voici votre <a href=\"[[lien_partage]]\">photo souvenir</a></p><p>\r\n</p><p>Suivez-nous sur <a href=\"https://fr-fr.facebook.com/groupe.tanguy.materiaux/\">nos réseaux sociaux</a> !</p><p>[[miniature_lien]]</p>', 0, 752, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Bonne Pioche télévision', 'Soirée Perchée - Bonne Pioche', '<p>Bonne Pioche Télévision vous remercie d\'avoir participé à sa Soirée \r\nPerchée. </p><p>Nous espérons que vous avez passé un bon moment.</p><p><a href=\"[[lien_partage]]\">Voici votre photo souvenir !</a></p><p>[[miniature_lien]]</p><p> </p><p>N\'hésitez pas à\r\n suivre notre actualité en ligne.</p><p>\r\n</p><p>Facbook :&nbsp;<a href=\"https://www.facebook.com/BonnePiocheProd/?fref=ts\" target=\"_blank\" rel=\"noreferrer nofollow\">https://www.facebook.com/BonnePiocheProd/?fref=ts</a><br>Twitter :&nbsp;<a href=\"https://twitter.com/\" target=\"_blank\" rel=\"noreferrer nofollow\">https://twitter.com</a><br>Instagram :&nbsp;<a href=\"https://www.instagram.com/bonnepioche/\" target=\"_blank\" rel=\"noreferrer nofollow\">https://www.instagram.com/bonnepioche/</a><br>Site Internet :&nbsp;<a href=\"https://bonnepioche.fr\">https://bonnepioche.fr</a></p>', 0, 753, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Tanguy Matériaux', 'Votre photo souvenir !', '<p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Merci pour votre participation!</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Voici <a href=\"[[lien_partage]]\">votre photo souvenir</a></p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Suivez-nous sur <a href=\"https://fr-fr.facebook.com/groupe.tanguy.materiaux/ \">nos réseaux sociaux </a>!</p><p style=\"margin-bottom: 8px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">[[miniature_lien]]</p>', 0, 758, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Soirée des présidents de COMUT', 'Votre photo souvenir !', '<p>Bonsoir,</p><p>Merci d\'avoir participé à la soirée des présidents de COMUT. </p><p>Pour immortaliser ce moment,<a href=\"[[lien_partage]]\"> retrouvez en pièce jointe votre photo !</a></p><p>[[miniature_lien]]</p><p>Bonne journée.</p>', 0, 761, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
