('contact@selfizee.fr', 'Cabinet Médical', 'Photo souvenir 15 ans du cabinet chirurgie oral', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Bonjour,</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Merci d’avoir participé à cette superbe soirée !</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Voici un <a href=\"[[lien_partage]]\">joli souvenir</a> de ce moment !</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">A très bientôt</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">[[miniature_lien]]<br></span><br></p>', 0, 766, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Service Plan ', 'Votre photo souvenir Finacca Summer Team 2018 !', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Bonjour,</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">Voici un<a href=\"[[lien_partage]]\"> joli souvenir </a>de cette aventure !</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">A très bientôt</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(237, 239, 240);\">[[miniature_lien]]&nbsp;&nbsp;<br></span><br></p>', 0, 779, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'Crédit Agricole Bretagne', 'Votre photo souvenir !', '<p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Le Crédit Agricole en Bretagne vous remercie de votre participation à la soirée des 10 ans des coopérations bretonnes, le 2 juillet 2018.</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Nous sommes heureux de vous faire parvenir <a href=\"[[lien_partage]]\">votre photo souvenir.</a></p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">[[miniature_lien]]</p><p style=\"margin-bottom: 8px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">A très bientôt,</p><p style=\"margin-bottom: 0px; text-overflow: ellipsis; word-wrap: break-word; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif; font-size: 14px;\">Le Crédit Agricole en Bretagne</p>', 0, 788, '2018-08-22 10:59:00', '2018-08-22 10:59:00'),
('contact@selfizee.fr', 'CC Chateaubriand - Derval', 'Tour de France 2018 - Votre photo souvenir', '<p>Le Tour de France 2018 était de passage à Derval ... et vous y étiez ! </p><p>Retrouvez votre photo souvenir dans quelques minutes sur le compte Facebook de la Communauté de Communes Châteaubriant – Derval :&nbsp;<a href=\"https://www.facebook.com/pg/Les-Infos-de-la-Com-Com-161842818025/photos/?tab=album&amp;album_id=10155955683073026\">à cette adresse</a>. <br>Et n\'hésitez pas à partager les événements de la journée avec vos amis et contacts grâce au hashtag #TDF2018Derval !</p><p>A très bientôt lors d\'un prochain rendez-vous dans l\'une des 26 communes du territoire Châteaubriant – Derval.</p><p>Pour tout renseignement : tourisme@cc-chateaubriant-derval.fr</p><p>Pour suivre l\'actualité et l\'agenda des animations du territoire Châteaubriant – Derval :</p><p><a href=\"https://www.facebook.com/Les-Infos-de-la-Com-Com-161842818025/\">Facebook</a>&nbsp;- <a href=\"https://twitter.com/ChbtDerval\">Twitter</a>&nbsp;-&nbsp;&nbsp;<a href=\"https://www.youtube.com/channel/UCIU22uQzRR1DR8PlRaSnVvA\">YouTube</a>&nbsp;</p>', 0, 794, '2018-08-22 10:59:00', '2018-08-22 10:59:00');
