('contact@selfizee.fr', 'CA de Savoie', 'Musilac : votre photo ', '<p>\r\nRetrouvez votre photo sur la page Facebook du Crédit Agricole des Savoie <a href=\"https://www.facebook.com/pg/Credit.Agricole.Des.Savoie/photos/?tab=album&amp;album_id=10155724245584150\">sur cette page</a></p><p><b>VOUS VOULEZ GAGNER VOTRE PLACE POUR MUSILAC 2019&nbsp;?\r\n</b></p><p>-	Mentionnez vos amis en commentaire pour qu’ils likent votre photo<br>-	Tirage au sort parmi les photos les 15 photos les plus likées !</p><p>\r\nMerci de votre passage sur le stand Crédit Agricole des Savoie à Musilac&nbsp;!</p><p>Site internet :&nbsp;<a href=\"https://www.ca-des-savoie.fr/\" style=\"font-family: Calibri; font-size: 11pt; background-color: rgb(255, 255, 255);\">Ca-de-savoie.fr</a></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>JA</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpe